import './App.css';

import React from 'react';

function App() {
  return (
    <div>
      <h1>List of tasks</h1>
      <ul>
        <li>Element listy 1</li>
        <li>Element listy 2</li>
        <li>Element listy 3</li>
      </ul>
    </div>
  );
}

export default App;
